import React from 'react';
import { Button, Form } from 'react-bootstrap';

const Home = () => {

  return (
    <div>
      <header>
       <h1>Explore</h1>
       <h1>Mars</h1>
      </header>

      <Form>
      <Form.Group className="mb-3" controlId='command'>
        <Form.Label>Write a Command!</Form.Label>
        <Form.Control type="text" placeholder="Only M R L allowed!"></Form.Control>
      </Form.Group>
      <Button type="submit">
        Submit
      </Button>
      </Form>
    </div>
  );
};

export default Home;
